<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Spotify Missing Tracks - Discovery Tool</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            padding: 20px;
            min-height: 100vh;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
            background: white;
            border-radius: 16px;
            box-shadow: 0 20px 60px rgba(0,0,0,0.3);
            overflow: hidden;
        }

        .header {
            background: linear-gradient(135deg, #1DB954 0%, #1ed760 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }

        .header h1 {
            font-size: 2.5em;
            margin-bottom: 10px;
        }

        .header p {
            font-size: 1.1em;
            opacity: 0.9;
        }

        .stats {
            background: #f8f9fa;
            padding: 20px 30px;
            display: flex;
            justify-content: space-around;
            flex-wrap: wrap;
            border-bottom: 2px solid #e9ecef;
        }

        .stat-box {
            text-align: center;
            padding: 10px 20px;
        }

        .stat-number {
            font-size: 2em;
            font-weight: bold;
            color: #1DB954;
        }

        .stat-label {
            color: #6c757d;
            font-size: 0.9em;
            margin-top: 5px;
        }

        .controls {
            padding: 30px;
            background: #fff;
            border-bottom: 2px solid #e9ecef;
        }

        .search-box {
            display: flex;
            gap: 15px;
            margin-bottom: 20px;
            flex-wrap: wrap;
        }

        .search-input {
            flex: 1;
            min-width: 300px;
            padding: 12px 20px;
            font-size: 16px;
            border: 2px solid #dee2e6;
            border-radius: 8px;
            transition: all 0.3s;
        }

        .search-input:focus {
            outline: none;
            border-color: #1DB954;
            box-shadow: 0 0 0 3px rgba(29, 185, 84, 0.1);
        }

        .filter-group {
            display: flex;
            gap: 10px;
            flex-wrap: wrap;
        }

        select {
            padding: 12px 20px;
            font-size: 16px;
            border: 2px solid #dee2e6;
            border-radius: 8px;
            background: white;
            cursor: pointer;
        }

        .button {
            padding: 12px 24px;
            font-size: 16px;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            transition: all 0.3s;
            font-weight: 600;
        }

        .button-primary {
            background: #1DB954;
            color: white;
        }

        .button-primary:hover {
            background: #1ed760;
            transform: translateY(-2px);
            box-shadow: 0 4px 12px rgba(29, 185, 84, 0.4);
        }

        .button-secondary {
            background: #6c757d;
            color: white;
        }

        .button-secondary:hover {
            background: #5a6268;
        }

        .table-container {
            overflow-x: auto;
            padding: 0 30px 30px 30px;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            font-size: 14px;
        }

        thead {
            background: #f8f9fa;
            position: sticky;
            top: 0;
            z-index: 10;
        }

        th {
            padding: 15px 12px;
            text-align: left;
            font-weight: 600;
            color: #495057;
            border-bottom: 2px solid #dee2e6;
            cursor: pointer;
            user-select: none;
        }

        th:hover {
            background: #e9ecef;
        }

        th::after {
            content: ' ⇅';
            opacity: 0.3;
        }

        td {
            padding: 12px;
            border-bottom: 1px solid #e9ecef;
        }

        tbody tr:hover {
            background: #f8f9fa;
        }

        .track-name {
            font-weight: 600;
            color: #212529;
        }

        .artist-name {
            color: #6c757d;
        }

        .link-group {
            display: flex;
            gap: 10px;
        }

        .link-button {
            padding: 6px 12px;
            border-radius: 6px;
            text-decoration: none;
            font-size: 12px;
            font-weight: 600;
            transition: all 0.2s;
            display: inline-block;
        }

        .spotify-link {
            background: #1DB954;
            color: white;
        }

        .spotify-link:hover {
            background: #1ed760;
            transform: scale(1.05);
        }

        .lastfm-link {
            background: #d51007;
            color: white;
        }

        .lastfm-link:hover {
            background: #ff0000;
            transform: scale(1.05);
        }

        .tidal-link {
            background: #000000;
            color: white;
        }

        .tidal-link:hover {
            background: #333333;
            transform: scale(1.05);
        }

        .no-results {
            text-align: center;
            padding: 60px 20px;
            color: #6c757d;
            font-size: 1.2em;
        }

        @media (max-width: 768px) {
            .header h1 {
                font-size: 1.8em;
            }

            .stats {
                flex-direction: column;
            }

            .search-box {
                flex-direction: column;
            }

            .search-input {
                min-width: 100%;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <h1>🎵 Spotify Missing Tracks Discovery</h1>
            <p>Tracks from Spotify not available in Tidal - Fast discovery tool</p>
        </div>

        <div class="stats">
            <div class="stat-box">
                <div class="stat-number" id="totalTracks">1,981</div>
                <div class="stat-label">Total Missing Tracks</div>
            </div>
            <div class="stat-box">
                <div class="stat-number" id="displayedTracks">1,981</div>
                <div class="stat-label">Displayed</div>

            <div class="stat-box">
                <div class="stat-number" id="uniqueArtists">490</div>
                <div class="stat-label">Unique Artists</div>
            </div>
        </div>

        <div class="controls">
            <div class="search-box">
                <input 
                    type="text" 
                    id="searchInput" 
                    class="search-input" 
                    placeholder="🔍 Search by track name, artist, or album..."
                >
                <button class="button button-secondary" onclick="clearFilters()">Clear All</button>
            </div>

            <div class="filter-group">
                <select id="playlistFilter">
                    <option value="">All Playlists</option>
                </select>
                <select id="typeFilter">
                    <option value="">All Types</option>
                </select>
            </div>
        </div>

        <div class="table-container">
            <table id="tracksTable">
                <thead>
                    <tr>
                        <th onclick="sortTable(0)">Track</th>
                        <th onclick="sortTable(1)">Artist</th>
                        <th onclick="sortTable(2)">Album</th>
                        <th onclick="sortTable(3)">Playlist</th>
                        <th onclick="sortTable(4)">Type</th>
                        <th>Discovery Links</th>
                    </tr>
                </thead>
                <tbody id="tracksBody">
                </tbody>
            </table>
            <div id="noResults" class="no-results" style="display: none;">
                No tracks found matching your search criteria 😔
            </div>
        </div>
    </div>

s:\/\/www.last.fm\/user\/sugarsmax\/library\/music\/+noredirect\/Danielle%2BMiraglia\/Box%2Bof%2BTroubles\/Drive","tidal_url":"https:\/\/tidal.com\/search?q=%22Danielle%20Miraglia%22%20%22Drive%22"},{"Track name":"Glimmer of Gold","Artist name":"Danielle Miraglia","Album":"Box of Troubles","Playlist name":"Susan_other","Type":"playlist","spotify_url":"https:\/\/open.spotify.com\/search\/Danielle%20Miraglia%20Glimmer%20of%20Gold","lastfm_url":"https:\/\/www.last.fm\/user\/sugarsmax\/library\/music\/+noredirect\/Danielle%2BMiraglia\/Box%2Bof%2BTroubles\/Glimmer%2Bof%2BGold","tidal_url":"https:\/\/tidal.com\/search?q=%22Danielle%20Miraglia%22%20%22Glimmer%20of%20Gold%22"},{"Track name":"Good Times","Artist name":"Danielle Miraglia","Album":"Box of Troubles","Playlist name":"Susan_other","Type":"playlist","spotify_url":"https:\/\/open.spotify.com\/search\/Danielle%20Miraglia%20Good%20Times","lastfm_url":"https:\/\/www.last.fm\/user\/sugarsmax\/library\/music\/+noredirect\/Danielle%2BMiraglia\/Box%2Bof%2BTroubles\/Good%2BTimes","tidal_url":"https:\/\/tidal.com\/search?q=%22Danielle%20Miraglia%22%20%22Good%20Times%22"},{"Track name":"Kaimana Hila","Artist name":"Hawaiian Ukulele Players","Album":"Hawaiian Wedding Music","Playlist name":"Liked from Radio","Type":"playlist","spotify_url":"https:\/\/open.spotify.com\/search\/Hawaiian%20Ukulele%20Players%20Kaimana%20Hila","lastfm_url":"https:\/\/www.last.fm\/user\/sugarsmax\/library\/music\/+noredirect\/Hawaiian%2BUkulele%2BPlayers\/Hawaiian%2BWedding%2BMusic\/Kaimana%2BHila","tidal_url":"https:\/\/tidal.com\/search?q=%22Hawaiian%20Ukulele%20Players%22%20%22Kaimana%20Hila%22"}];
        let filteredTracks = [...allTracks];
        let sortDirection = {};

        // Initialize page
        function init() {
            populateFilters();
            renderTable(filteredTracks);
            setupEventListeners();
        }

        function populateFilters() {
            // Populate playlist filter
            const playlists = [...new Set(allTracks.map(t => t['Playlist name']))].sort();
            const playlistSelect = document.getElementById('playlistFilter');
            playlists.forEach(playlist => {
                const option = document.createElement('option');
                option.value = playlist;
                option.textContent = playlist;
                playlistSelect.appendChild(option);
            });

            // Populate type filter
            const types = [...new Set(allTracks.map(t => t['Type']))].sort();
            const typeSelect = document.getElementById('typeFilter');
            types.forEach(type => {
                const option = document.createElement('option');
                option.value = type;
                option.textContent = type;
                typeSelect.appendChild(option);
            });
        }

        function setupEventListeners() {
            document.getElementById('searchInput').addEventListener('input', filterTracks);
            document.getElementById('playlistFilter').addEventListener('change', filterTracks);
            document.getElementById('typeFilter').addEventListener('change', filterTracks);
        }

        function filterTracks() {
            const searchTerm = document.getElementById('searchInput').value.toLowerCase();
            const playlistFilter = document.getElementById('playlistFilter').value;
            const typeFilter = document.getElementById('typeFilter').value;

            filteredTracks = allTracks.filter(track => {
                const trackName = (track['Track name'] || '').toLowerCase();
                const artistName = (track['Artist name'] || '').toLowerCase();
                const albumName = (track['Album'] || '').toLowerCase();

                const matchesSearch = searchTerm === '' || 
                    trackName.includes(searchTerm) ||
                    artistName.includes(searchTerm) ||
                    albumName.includes(searchTerm);

                const matchesPlaylist = playlistFilter === '' || track['Playlist name'] === playlistFilter;
                const matchesType = typeFilter === '' || track['Type'] === typeFilter;

                return matchesSearch && matchesPlaylist && matchesType;
            });

            renderTable(filteredTracks);
            updateStats();
        }

        function renderTable(tracks) {
            const tbody = document.getElementById('tracksBody');
            const noResults = document.getElementById('noResults');

            if (tracks.length === 0) {
                tbody.innerHTML = '';
                noResults.style.display = 'block';
                return;
            }

            noResults.style.display = 'none';

            tbody.innerHTML = tracks.map(track => `
                <tr>
                    <td class="track-name">${escapeHtml(track['Track name'])}</td>
                    <td class="artist-name">${escapeHtml(track['Artist name'])}</td>
                    <td>${escapeHtml(track['Album'])}</td>
                    <td>${escapeHtml(track['Playlist name'])}</td>
                    <td>${escapeHtml(track['Type'])}</td>
                    <td>
                        <div class="link-group">
                            <a href="${track.spotify_url}" target="_blank" class="link-button spotify-link">
                                Spotify
                            </a>
                            <a href="${track.lastfm_url}" target="_blank" class="link-button lastfm-link">
                                Last.fm
                            </a>
                            <a href="${track.tidal_url}" target="_blank" class="link-button tidal-link">
                                Tidal
                            </a>
                        </div>
                    </td>
                </tr>
            `).join('');
        }

        function sortTable(columnIndex) {
            const columns = ['Track name', 'Artist name', 'Album', 'Playlist name', 'Type'];
            const column = columns[columnIndex];

            sortDirection[column] = !sortDirection[column];

            filteredTracks.sort((a, b) => {
                const aVal = String(a[column]).toLowerCase();
                const bVal = String(b[column]).toLowerCase();

                if (aVal < bVal) return sortDirection[column] ? -1 : 1;
                if (aVal > bVal) return sortDirection[column] ? 1 : -1;
                return 0;
            });

            renderTable(filteredTracks);
        }

        function clearFilters() {
            document.getElementById('searchInput').value = '';
            document.getElementById('playlistFilter').value = '';
            document.getElementById('typeFilter').value = '';
            filterTracks();
        }

        function updateStats() {
            document.getElementById('displayedTracks').textContent = filteredTracks.length.toLocaleString();
        }

        function escapeHtml(text) {
            const div = document.createElement('div');
            div.textContent = text || '';
            return div.innerHTML;
        }

        // Initialize on load
        init();
    </script>
